class Solution {
    func numberOfPowerfulInt(_ start: Int, _ finish: Int, _ limit: Int, _ s: String) -> Int {
        var count = 0
        var current = Int(s)!

        // Early return if s itself is not within the start-finish range
        if current < start || current > finish {
            return 0
        }

        while current <= finish {
            if current >= start && current <= finish && allDigitsAreWithinLimit(String(current), limit) {
                count += 1
            }
            let next = "1" + String(current)
            guard let nextInt = Int(next) else { break }
            if nextInt > finish { break }
            current = nextInt
        }

        // Check for powerful integers with s as suffix and a prefix that satisfies the limit condition
        var multiplier = 10
        while true {
            let base = s.count + 1
            var prefix = 1
            while prefix < multiplier {
                let candidateStr = "\(prefix)\(s)"
                guard let candidate = Int(candidateStr), candidate >= start, candidate <= finish else {
                    prefix += 1
                    continue
                }
                if allDigitsAreWithinLimit(candidateStr, limit) {
                    count += 1
                }
                prefix += 1
            }
            if base + String(multiplier).count > String(finish).count { break }
            multiplier *= 10
        }

        return count
    }

    private func allDigitsAreWithinLimit(_ str: String, _ limit: Int) -> Bool {
        for digit in str {
            if let digitInt = Int(String(digit)), digitInt > limit {
                return false
            }
        }
        return true
    }
}
